import React from "react";


function Home() {
  return (
   <>
    <div className="home">
      <main>
        <h1>TechyStar</h1>
        <p>Solution to all your Problem </p>
      </main>
    </div>
    <div className="home2">
      <img src="{vg}" alt="" />
    </div>
   </>
  );
}

export default Home;
